sequences = re.findall(r'[ATGC]+', dataset)


def fcm(sequences, motif):
    for sequence in sequences:
        if motif not in sequence:
            return False
    return True

common_motifs = []


for i in range(2, len(sequences[0]) + 1):
    for j in range(len(sequences[0]) - i + 1):
        motif = sequences[0][j:j + i]
        if fcm(sequences, motif):
            common_motifs.append(motif)

print (max(common_motifs, key=len))
